import React from 'react';
import './NewSlider.css';




function NewSlider({props}) {
    const handleChange = (e, index) => {
        const newDate = Number(e.target.value);
        const newRange = index === 0 ? [newDate, props.dateRange[1]] : [props.dateRange[0], newDate];
    
        if (props.newRange[0] <= props.newRange[1]) {
            setDateRange(newRange);
        }
    };

    return(
        <div class="range">
        <div class="range-slider">
            <span class="range-selected"></span>
        </div>
        <div class="range-input">
            <input 
                type="range" 
                class="min" 
                min={0}
                max={2023-10+1} 
                value={0} 
                step="1"
                onChange={(e) => handleChange(e, 0)}
                />
            <input 
                type="range" 
                class="max" 
                min={0} 
                max={2023-10+1} 
                value={5} 
                step="1"
                onChange={(e) => handleChange(e,0)}/>
        </div>
        <div class="range-price">      
            <label for="min">Min</label>
            <input type="number" name="min" value={2010+props.dateRange[0]}/>      
            <label for="max">Max</label>
            <input type="number" name="max" value={2010+props.dateRange[1]}/>      
        </div>
    </div> 
  );
  }

export default NewSlider;
